export function safeKeyListener() {
  const queue = [];
  let resolvePending = null;
  let closed = false;
  const listener = (key) => {
    if (closed) return;
    if (resolvePending) {
      const resolve = resolvePending;
      resolvePending = null;
      resolve(key);
      return;
    }
    queue.push(key);
  };
  if (process.stdin.isTTY) {
    process.stdin.setRawMode(true);
  }
  process.stdin.resume();
  process.stdin.on('data', listener);
  const nextKey = async () => {
    if (closed) {
      throw new Error('KeyListener destroyed');
    }
    if (queue.length > 0) {
      return queue.shift();
    }
    return new Promise((resolve) => {
      resolvePending = resolve;
    });
  };
  const destroy = () => {
    closed = true;
    if (resolvePending) {
      resolvePending(new Error('KeyListener destroyed'));
      resolvePending = null;
    }
    process.stdin.removeListener('data', listener);
    if (process.stdin.isTTY) {
      process.stdin.setRawMode(false);
    }
    process.stdin.pause();
  };
  return { nextKey, destroy };
}

export function safeKeyListener(handler) {
  const { stdin } = useStdin();
  stdin.setRawMode?.(true);
  const onData = (data) => {
    handler(Buffer.from(data).toString('hex'));
  };
  stdin.on('data', onData);
  return () => {
    stdin.removeListener('data', onData);
    stdin.setRawMode?.(false);
  };
}

